This beautiful Essential Oil Rack is made of Walnut, Oak, Cedar, or Pine. The profile picture shows Walnut. The other pictures are Oak with a clear cost applied. It is designed to hold 57 (15ml) bottles. It measures 4 1/2&quot; tall 10 1/2&quot; and 17&quot; wide. The item pictured is natural Walnut with no clear coat on it. This beautiful piece will help you organize your oils. 

All items are handmade in the order they are received. These are not premade so plan on a lead time with them upon ordering. 

Each unit will vary a little in color as all wood has variances and wont be identical.

Height 4 1/2&quot;
Depth 10 1/2&quot;
Length 17&quot;

Choose your type of wood and natural or lacquered at checkout.
